import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Order from './pages/Order.jsx';
import LoginSignUp from './pages/profile.jsx';

const App = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='/' element={<Order />} />
        <Route path='/addMaterials' element={<AddMaterials />} /> {/* PascalCase */}
        <Route path='/materials' element={<Materials />} />
        <Route path='/profile' element={<profile />} /> {/* PascalCase */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
